import React, {useState} from 'react'
import Searcho from './components/Searcho'
import axios from "axios";


function App() {
    const [state, setState] = useState({
        value : '',

    });

    const keyEvent = (e) =>{
        const newValue = e.target.value
        console.log(newValue)
        setState({
            value: newValue
        })
    }

    const enterEvent = (e) => {
        // console.log(e.key)
        if(e.key === 'Enter'){
            alert();

        }
    }

    return (
        <div>
            <Searcho keyEvent={keyEvent} enterEvent={enterEvent} />
        </div>
    )
}

export default App
